import { BrowserRouter, Routes, Route } from "react-router-dom";
import Qoute from "./quoterandom/Qoute";

function App() {
  <BrowserRouter>
    <Routes>
      <Route path="/" element={Qoute} />
    </Routes>
  </BrowserRouter>;
}

export default App;
